import { useEffect, useState } from "react"
import { fetchUserStudents } from "../services/studentServices"
import { fetchAllStudentWorksheets, fetchUserWorksheets } from "../services/worksheetServices"
import { Link } from "react-router-dom"

export const Home = ({ user }) => {

    const [studentWorksheets, setStudentWorksheets] = useState([])
    const [userInfo, setUserInfo] = useState({})
    const [userStudents, setUserStudents] = useState([])
    const [userWorksheets, setUserWorksheets] = useState([])

    const handleFetchCalls = () => {
        fetchUserStudents(user?.id).then((data) => {
            setUserStudents(data)
        })
        fetchUserWorksheets(user?.id).then((data) => {
            setUserWorksheets(data)
        })
        setUserInfo(user)
        fetchAllStudentWorksheets().then((data) => {
            const filterStudentWorksheets = data.filter((datum) => datum.isComplete === true)
            setStudentWorksheets(filterStudentWorksheets)
        })
    }
    useEffect(() => {
        handleFetchCalls()
    }, [user.id])

    return (
        <div className="relative h-screen isolate overflow-hidden bg-gray-900 py-16 sm:py-24 lg:py-32">
            <div className="mx-auto max-w-7xl px-6 lg:px-8">
                <div className="mx-auto grid max-w-2xl grid-cols-1 gap-x-8 gap-y-16 lg:max-w-none lg:grid-cols-2">
                    <div className="max-w-xl lg:max-w-lg">
                        <h2 className="text-3xl font-bold tracking-tight text-white sm:text-4xl">Welcome {user.firstName}</h2>
                        <p className="mt-4 text-lg leading-8 text-gray-300">{user?.aboutMe}</p>
                        <div className="mt-6 flex max-w-md gap-x-4">
                            <label for="email-address" className="sr-only">Email address</label>
                            <input id="email-address" name="email" type="email" autocomplete="email" required className="min-w-0 flex-auto rounded-md border-0 bg-white/5 px-3.5 py-2 text-white shadow-sm ring-1 ring-inset ring-white/10 focus:ring-2 focus:ring-inset focus:ring-indigo-500 sm:text-sm sm:leading-6" placeholder="Enter something about yourself" />
                            <button type="submit" className="flex-none rounded-md bg-indigo-500 px-3.5 py-2.5 text-sm font-semibold text-white shadow-sm hover:bg-indigo-400 focus-visible:outline focus-visible:outline-2 focus-visible:outline-offset-2 focus-visible:outline-indigo-500">Update</button>
                        </div>
                    </div>
                    <dl className="grid grid-cols-1 gap-x-8 gap-y-10 sm:grid-cols-2 lg:pt-2">
                        <div className="flex flex-col items-start">
                            <div className="rounded-md bg-white/5 p-2 ring-1 ring-white/10">
                                <Link to={'/students'}>
                                    <svg className="h-6 w-6 text-white" fill="none" viewBox="0 0 24 24" stroke-width="1.5" stroke="currentColor" aria-hidden="true">
                                        <path stroke-linecap="round" stroke-linejoin="round" d="M6.75 3v2.25M17.25 3v2.25M3 18.75V7.5a2.25 2.25 0 012.25-2.25h13.5A2.25 2.25 0 0121 7.5v11.25m-18 0A2.25 2.25 0 005.25 21h13.5A2.25 2.25 0 0021 18.75m-18 0v-7.5A2.25 2.25 0 015.25 9h13.5A2.25 2.25 0 0121 11.25v7.5m-9-6h.008v.008H12v-.008zM12 15h.008v.008H12V15zm0 2.25h.008v.008H12v-.008zM9.75 15h.008v.008H9.75V15zm0 2.25h.008v.008H9.75v-.008zM7.5 15h.008v.008H7.5V15zm0 2.25h.008v.008H7.5v-.008zm6.75-4.5h.008v.008h-.008v-.008zm0 2.25h.008v.008h-.008V15zm0 2.25h.008v.008h-.008v-.008zm2.25-4.5h.008v.008H16.5v-.008zm0 2.25h.008v.008H16.5V15z" />
                                    </svg>
                                </Link>
                            </div>
                            <dt className="mt-4 font-semibold text-white">{userStudents?.length} students added</dt>
                            <dd className="mt-2 leading-7 text-gray-400">Click on the icon to see all students.</dd>
                        </div>
                        <div className="flex flex-col items-start">
                            <div className="rounded-md bg-white/5 p-2 ring-1 ring-white/10">
                                <Link to={'/worksheets'}>
                                    <svg className="h-6 w-6 text-white" fill="none" viewBox="0 0 24 24" stroke-width="1.5" stroke="currentColor" aria-hidden="true">
                                        <path stroke-linecap="round" stroke-linejoin="round" d="M6.75 3v2.25M17.25 3v2.25M3 18.75V7.5a2.25 2.25 0 012.25-2.25h13.5A2.25 2.25 0 0121 7.5v11.25m-18 0A2.25 2.25 0 005.25 21h13.5A2.25 2.25 0 0021 18.75m-18 0v-7.5A2.25 2.25 0 015.25 9h13.5A2.25 2.25 0 0121 11.25v7.5m-9-6h.008v.008H12v-.008zM12 15h.008v.008H12V15zm0 2.25h.008v.008H12v-.008zM9.75 15h.008v.008H9.75V15zm0 2.25h.008v.008H9.75v-.008zM7.5 15h.008v.008H7.5V15zm0 2.25h.008v.008H7.5v-.008zm6.75-4.5h.008v.008h-.008v-.008zm0 2.25h.008v.008h-.008V15zm0 2.25h.008v.008h-.008v-.008zm2.25-4.5h.008v.008H16.5v-.008zm0 2.25h.008v.008H16.5V15z" />
                                    </svg>
                                </Link>
                            </div>
                            <dt className="mt-4 font-semibold text-white">{userWorksheets?.length} worksheets added</dt>
                            <dd className="mt-2 leading-7 text-gray-400">Click on the icon to see all worksheets.</dd>
